import React, { Component } from 'react'
import { Page } from '..'
import AppPreviewSection from './Components/AppPreviewSection'

export default class About extends Component {
    render() {
        return (
            <Page className="about-page">
                About
                <AppPreviewSection />
            </Page>
        )
    }
}
